(76, 110, 245,1); // 品牌蓝\n \n $blue_color: #3ca0f6; // 常规蓝 链接色\n $light_blue_color: #e8eff8; // 浅蓝\n \n $second_blue_color: rgba(133, 165, 194, 1); // 灰蓝色\n \n //渐变色\n $gradient_blue_color_1: #3ca0f6; // 渐变蓝 - 1\n $gradient_blue_color_2: #3b71e8;; // 渐变蓝 - 2\n \n // 场景 辅色\n $success_color: #67c23a; // 常规绿 成功色\n $light_success_color: #eff8eb; // 浅绿 用于成功等正确性提示配色（次要）\n \n $warn_color: #e6a23a; // 常规橙 警告色\n $light_warn_color: #fcf5eb; // 浅橙 用于文字背景色（次要）\n \n $danger_color: #f56c6c; // 常规红 危险色\n $light_danger_color: #fef0f0; // 浅红 用于警告或者错误提示（次要）\n \n // 文本 颜色\n $main_text_color: #303133; // 用于标题、正文等\n $second_text_color: #606266; // 次级文本\n $third_text_color: #909399; // 辅助文本\n $fourth_text_color: #c0c4cc; // 禁用文本 / 字体图标颜色\n \n //边框 颜色 pc 与 移动端 有区别, 请留意\n $border_color: rgb(212, 227, 240);\n $second_border_color: #cecece; //用于默认边框颜色、分割线等\n $third_border_color: #ebeef5;  //用于标题下划线等\n $fourth_border_color: #f2f6f7;  //用于辅助边框等\n \n //背景色 pc 与 移动端 有区别, 请留意\n $main_bg_color: rgba(245, 247, 250, 1);  //用于默认背景色、下拉鼠标悬停背景、禁用状态背景等\n $second_bg_color:#f0f2f5; //用于辅助背景色等\n \n // 标签\n $main_color_15: rgba(27, 101, 185, .15); // 15%品牌蓝 标签背景\n $main_color_30: rgba(27, 101, 185, .3); // 30%品牌蓝 标签描边\n $success_color_15: rgba(103, 194, 58, .15); // 15%品牌绿 标签背景\n $success_color_30: rgba(103, 194, 58, .3); // 30%品牌绿 标签背景\n $danger_color_15: rgba(245, 108, 108, .15); // 标签背景\n $danger_color_30: rgba(245, 108, 108, .3); // 标签描边\n $warn_color_15: rgba(230, 162, 60, .15); // 标签背景\n $warn_color_30: rgba(230, 162, 60, .3); // 标签描边\n $third_text_color_15: rgba(144, 147, 153, .15); // 标签背景\n $third_text_color_30: rgba(144, 147, 153, .3);// 标签描边\n \n // 表格\n $second_border_color-table: rgba(206, 206, 206, .3); //表格横线\n \n // 投影\n $shadow_1: 0px 2px 4px 0px rgba(0, 0, 0, .2);\n $shadow_2: 0 5px 10px 0 rgba(0, 0, 0, 0.15);\n \n // 遮罩\n $mask_black: rgba(0, 0, 0, .2); //弹窗背景遮罩颜色-黑色\n $mask_white: rgba(255, 255, 255, .7); //弹窗背景遮罩颜色-白色\n \n //其他\n $white_color:#ffffff;\n /*******theme-end********/\n \n \n /*******space-start********/\n /*\n  * 02 间距\n  * 规则：$space_{间距} 变量统一采用下划线命名规范\n  */\n  $space_4: 4px;\n  $space_6: 6px;\n  $space_8: 8px;\n  $space_10: 10px;\n  $space_12: 12px;\n  $space_16: 16px;\n  $space_20: 20px;\n  $space_24: 24px;\n  $space_32: 32px;\n  $space_40: 40px;\n  $space_48: 48px;\n /*******space-end********/\n \n \n /*******layout-start********/\n /*\n  * 03 布局变量\n  * 内容：sidebar、header、版心、navbar、footer\n  */\n // sidebar样式变量  默认主题样式\n $menu_text: $main_text_color;//菜单模块的字颜色 \n $menu_active_text: white;//2菜单选中的字颜色\n \n $menu_bg:#fff; //sidebar菜单所有tab的默认展示背景色\n $menu_hover: red; //sidebar鼠标tab的hover颜色和tab选中active颜色\n \n \n $menu_active: $main_color; //选中的右边边框\n $sub_menu_bg: $main_color;//sidebar整个区块的背景色\n \n \n $sub_menu_hover: $light_blue_color; //sidebar二级tab的hover颜色\n $sub_menu_active_text: $main_text_color; //多级下拉，子集被选中，父级的显示字颜色\n \n \n $footer_bg_color:#fff; //底部背景颜色\n \n $page_padding: 16px; // 页面边距，规范16px\n //logo文字大小\n $logo_ft_large: 20px;//logo文字大\n $logo_ft_small: 14px;//logo文字小\n // 布局宽度\n $lay_width_1100: 1100px; // 中间版心宽度\n $side_bar_width: 54px; // sidebar的宽度\n //布局配置样式设置\n $breadcrumb_height: 48px;//面包屑高度\n $header_height: 70px;//头部headerbox区块高度，版式2\n $footer_height: 50px;//底部的高度\n $tags_height: 40px;//tagView 高度\n //版式1和2的公共样式\n $sidebar_item_fir_height: 40px; //sidebar1级的tab高度\n $sidebar_item_sec_height: 40px; //sidebar2级的tab高度\n /*******layout-end********/\n \n \n // the :export directive is the magic sauce for webpack\n // https://www.bluematador.com/blog/how-to-share-variables-between-js-and-sass\n :export {\n   // sidebar样式变量\n   menu_text: $menu_text;\n   menu_active_text: $menu_active_text;\n   menu_bg: $menu_bg;\n   menu_hover: $menu_hover;\n   menu_active: $menu_active;\n   sub_menu_active_text: $sub_menu_active_text;\n   sub_menu_bg: $sub_menu_bg;\n   sub_menu_hover: $sub_menu_hover;\n \n   //logo文字\n   logo_ft_large: $logo_ft_large;//logo文字大\n   logo_ft_small: $logo_ft_small;//logo文字小\n \n   //主题颜色\n   main_color: $main_color ;\n   blue_color:$blue_color;\n   light_blue_color: $light_blue_color;\n \n   // 渐变\n   gradient_blue_color_1:$gradient_blue_color_1;\n   gradient_blue_color_2:$gradient_blue_color_2;\n \n   // 场景\n   success_color:$success_color;\n   light_success_color: $light_success_color;\n \n   warn_color:$warn_color;\n   light_warn_color: $light_warn_color;\n \n   danger_color:$danger_color;\n   light_danger_color: $light_danger_color;\n \n   // 文本\n   main_text_color: $main_text_color;\n   second_text_color: $second_text_color;\n   third_text_color: $third_text_color;\n   fourth_text_color: $fourth_text_color;\n \n   //边框\n   border_color: $border_color;\n   second_border_color: $second_border_color;\n   third_border_color: $third_border_color;\n   fourth_border_color: $fourth_border_color;\n   \n   //背景色\n   main_bg_color: $main_bg_color;\n   second_bg_color: $second_bg_color;\n \n   // 标签\n   main_color_15: $main_color_15;\n   main_color_30: $main_color_30;\n   success_color_15: $success_color_15;\n   success_color_30: $success_color_30;\n   danger_color_15: $danger_color_15;\n   danger_color_30: $danger_color_30;\n   warn_color_15: $warn_color_15;\n   warn_color_30: $warn_color_30;\n   third_text_color_15: $third_text_color_15;\n   third_text_color_30: $third_text_color_30;\n \n   // 表格\n   second_border_color-table: $second_border_color-table;\n \n   // 投影\n   shadow_1: $shadow_1;\n   shadow_2: $shadow_2;\n \n   // 遮罩\n   mask_black: $mask_black;\n   mask_white: $mask_white;\n \n   //间距\n   space_4: $space_4;\n   space_6: $space_6;\n   space_8: $space_8;\n   space_10: $space_10;\n   space_12: $space_12;\n   space_16: $space_16;\n   space_20: $space_20;\n   space_24: $space_24;\n   space_32: $space_32;\n   space_40: $space_40;\n   space_48: $space_48;\n \n   // 布局宽度\n   lay_width_1100: $lay_width_1100;\n   side_bar_width: $side_bar_width;\n \n \n   // 布局配置样式设置\n   breadcrumb_height: $breadcrumb_height;\n   header_height: $header_height;\n   footer_height: $footer_he